window.bookSummaryJSON = "<p><b>Sometimes it takes a storm to clear the air.</b></p> <p>The showdown at Deadside changed everything. It’ll take us going in separate directions to stop the catastrophes that hover on the horizon. But there’s no anticipating the extra threat lying in wait. It’s been there all along.</p> <p>Invisible.</p> <p>Waiting.</p> <p>And it’s about to pounce.</p> <p><i>A kick-ass urban fantasy with a why-choose romance. Vampires, ghosts, angels, and demons. Perfect for listeners who enjoy forbidden romance, enemies to lovers, or friends to lovers.</i></p>"; 
